Cécile Loreen, fashion designer and entrepreneur. 

‘My biggest inspiration is life itself. When I look at my surroundings, I see a grey world, where people often think basic is enough. For me, fashion is a way of expressing myself with the goal of bringing a feel of fun and playfulness through pink and pastel colors. Those colors set my heart on fire, and inspire a youthful nostalgia. Because these colors aren’t common in mainstream fashion, I feel like bridging a gap that sparks people to have a more open-minded approach’.
